import React, { useState, useEffect, useCallback } from 'react';
import { fetchTasks, addTask, deleteTask, updateTask } from '../api'; // Beispiel-Pfade
import { fetchCategories, addCategory } from '../api'; // Beispiel-Pfade
import { sendWebSocketMessage, connectWebSocket, disconnectWebSocket } from '../websocket'; // Beispiel-Pfade

// Beispiel Icons, ersetze dies durch die tatsÃ¤chlichen Pfade deiner Icons
import { SparkleIcon, CustomCategoryIcon } from '../icons'; 

export function Dashboard({ userId }) {
  const [showEditTaskPopUp, setShowEditTaskPopUp] = useState(false);
  const [showAddTaskPopUp, setShowAddTaskPopUp] = useState(false);
  const [showAddCategoryPopUp, setShowAddCategoryPopUp] = useState(false);
  const [isDeleteMode, setIsDeleteMode] = useState(false);
  const [currentTask, setCurrentTask] = useState(null);
  const [tasks, setTasks] = useState([]);
  const [categories, setCategories] = useState([]);
  const [selectedCategory, setSelectedCategory] = useState(null);

  useEffect(() => {
    if (userId) {
      const fetchData = async () => {
        try {
          // Fetch tasks
          const fetchedTasks = await fetchTasks(userId);
          setTasks(fetchedTasks);

          // Fetch categories
          const fetchedCategories = await fetchCategories(userId);
          setCategories(fetchedCategories);
          if (fetchedCategories.length > 0) {
            setSelectedCategory(fetchedCategories[0]);
          }
        } catch (error) {
          console.error('Error fetching data:', error);
        }
      };

      fetchData();

      // Connect WebSocket
      connectWebSocket(handleWebSocketMessage);

      return () => {
        disconnectWebSocket();
      };
    }
  }, [userId]);

  const handleWebSocketMessage = useCallback((message) => {
    console.log('Received WebSocket message:', message);
    // Handle WebSocket message
    // Update tasks or categories based on the message
  }, []);

  const handleAddTask = async (newTask) => {
    try {
      const data = await addTask(newTask);
      setTasks(prevTasks => [...prevTasks, data]);
      sendWebSocketMessage(`/app/updateTask/${data.taskId}`, { ...data });
    } catch (error) {
      console.error('Error adding task:', error);
    }
  };

  const handleDeleteTask = async (taskId) => {
    try {
      await deleteTask(taskId);
      setTasks(prevTasks => prevTasks.filter(task => task.taskId !== taskId));
      sendWebSocketMessage(`/app/deleteTask/${taskId}`, { taskId });
    } catch (error) {
      console.error('Error deleting task:', error);
    }
  };

  const handleCheckboxChange = async (taskId) => {
    const updatedTodos = tasks.map(todo => {
      if (todo.taskId === taskId) {
        const updatedTodo = { ...todo, completed: !todo.completed };
        if (updatedTodo.completed) {
          updatedTodo.categoryId = 7; // Logbook category
        }
        return updatedTodo;
      }
      return todo;
    });

    setTasks(updatedTodos);

    const updatedTask = updatedTodos.find(todo => todo.taskId === taskId);
    try {
      await updateTask(taskId, updatedTask);
      sendWebSocketMessage(`/app/updateTask/${taskId}`, { ...updatedTask });
    } catch (error) {
      console.error('Error sending WebSocket message:', error);
    }
  };

  const handleDateChange = async (taskId, date, purpose) => {
    const updatedTodos = tasks.map(todo => {
      if (todo.taskId === taskId) {
        return {
          ...todo,
          [`${purpose}Date`]: date ? new Date(date).toISOString() : null,
        };
      }
      return todo;
    });

    setTasks(updatedTodos);

    const updatedTask = updatedTodos.find(todo => todo.taskId === taskId);
    try {
      await updateTask(taskId, updatedTask);
      sendWebSocketMessage(`/app/updateTask/${taskId}`, { ...updatedTask });
    } catch (error) {
      console.error('Error sending WebSocket message for date update:', error);
    }
  };

  const handleAddCategory = async (newCategory) => {
    try {
      const data = await addCategory(newCategory);
      setCategories(prevCategories => [...prevCategories, data]);
      sendWebSocketMessage(`/app/updateCategory/${data.categoryId}`, { ...data });
    } catch (error) {
      console.error('Error adding category:', error);
    }
  };

  return (
    <div>
      <h1>Dashboard</h1>
      <button onClick={() => setShowAddTaskPopUp(true)}>Add Task</button>
      <button onClick={() => setShowAddCategoryPopUp(true)}>Add Category</button>
      <button onClick={() => setIsDeleteMode(prev => !prev)}>
        {isDeleteMode ? 'Exit Delete Mode' : 'Enter Delete Mode'}
      </button>
      {showEditTaskPopUp && (
        <div>
          <h2>Edit Task</h2>
          {/* Implement your edit task form here */}
          <button onClick={() => setShowEditTaskPopUp(false)}>Close</button>
        </div>
      )}
      {showAddTaskPopUp && (
        <div>
          <h2>Add Task</h2>
          {/* Implement your add task form here */}
          <button onClick={() => setShowAddTaskPopUp(false)}>Close</button>
        </div>
      )}
      {showAddCategoryPopUp && (
        <div>
          <h2>Add Category</h2>
          {/* Implement your add category form here */}
          <button onClick={() => setShowAddCategoryPopUp(false)}>Close</button>
        </div>
      )}
      <div>
        <h2>Tasks</h2>
        <ul>
          {tasks.map(task => (
            <li key={task.taskId}>
              <input
                type="checkbox"
                checked={task.completed}
                onChange={() => handleCheckboxChange(task.taskId)}
              />
              {task.name}
              {/* Additional task details */}
              {isDeleteMode && <button onClick={() => handleDeleteTask(task.taskId)}>Delete</button>}
            </li>
          ))}
        </ul>
      </div>
      <div>
        <h2>Categories</h2>
        <ul>
          {categories.map(category => (
            <li key={category.categoryId}>
              {category.name}
              {/* Additional category details */}
            </li>
          ))}
        </ul>
      </div>
    </div>
  );
}
